<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\ApiKeyClient\Domain\ApiKeyClient;
use Civi\Lughauth\Features\Access\ApiKeyClient\Domain\ValueObject\ApiKeyClientCodeVO;
use Civi\Lughauth\Features\Access\ApiKeyClient\Domain\ValueObject\ApiKeyClientKeyVO;
use Civi\Lughauth\Features\Access\ApiKeyClient\Domain\ValueObject\ApiKeyClientEnabledVO;
use Civi\Lughauth\Features\Access\ApiKeyClient\Domain\ValueObject\ApiKeyClientScopesVO;
use Civi\Lughauth\Features\Access\ApiKeyClient\Domain\ValueObject\ApiKeyClientVersionVO;
use Civi\Lughauth\Features\Access\ApiKeyClient\Domain\ApiKeyClientAttributes;
use PHPUnit\Framework\TestCase;

final class ApiKeyClientAttributesUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new ApiKeyClientAttributes();
        $codeOneValue = 'one';
        $codeOtherValue = 'other';
        $copy = $value->code($codeOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getCode());
        $this->assertNotEquals('other', $value->getCode());
        $this->assertEquals('one', $value->getCodeOrDefault(ApiKeyClientCodeVO::from($codeOtherValue))->value());
        $this->assertNotEquals('other', $value->getCodeOrDefault(ApiKeyClientCodeVO::from($codeOtherValue))->value());
        $value->unsetCode();
        $this->assertEquals('other', $value->getCodeOrDefault(ApiKeyClientCodeVO::from($codeOtherValue))->value());
        $this->assertNotEquals('one', $value->getCodeOrDefault(ApiKeyClientCodeVO::from($codeOtherValue))->value());
        $keyOneValue = 'one';
        $keyOtherValue = 'other';
        $copy = $value->key($keyOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getKey());
        $this->assertNotEquals('other', $value->getKey());
        $this->assertEquals('one', $value->getKeyOrDefault(ApiKeyClientKeyVO::from($keyOtherValue))->value());
        $this->assertNotEquals('other', $value->getKeyOrDefault(ApiKeyClientKeyVO::from($keyOtherValue))->value());
        $value->unsetKey();
        $this->assertEquals('other', $value->getKeyOrDefault(ApiKeyClientKeyVO::from($keyOtherValue))->value());
        $this->assertNotEquals('one', $value->getKeyOrDefault(ApiKeyClientKeyVO::from($keyOtherValue))->value());
        $enabledOneValue = true;
        $enabledOtherValue = false;
        $copy = $value->enabled($enabledOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->getEnabled());
        $this->assertNotEquals(false, $value->getEnabled());
        $this->assertEquals(true, $value->getEnabledOrDefault(ApiKeyClientEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(false, $value->getEnabledOrDefault(ApiKeyClientEnabledVO::from($enabledOtherValue))->value());
        $value->unsetEnabled();
        $this->assertEquals(false, $value->getEnabledOrDefault(ApiKeyClientEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(true, $value->getEnabledOrDefault(ApiKeyClientEnabledVO::from($enabledOtherValue))->value());
        $scopesOneValue = 'one';
        $scopesOtherValue = 'other';
        $copy = $value->scopes($scopesOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getScopes());
        $this->assertNotEquals('other', $value->getScopes());
        $this->assertEquals('one', $value->getScopesOrDefault(ApiKeyClientScopesVO::from($scopesOtherValue))->value());
        $this->assertNotEquals('other', $value->getScopesOrDefault(ApiKeyClientScopesVO::from($scopesOtherValue))->value());
        $value->unsetScopes();
        $this->assertEquals('other', $value->getScopesOrDefault(ApiKeyClientScopesVO::from($scopesOtherValue))->value());
        $this->assertNotEquals('one', $value->getScopesOrDefault(ApiKeyClientScopesVO::from($scopesOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(ApiKeyClientVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(ApiKeyClientVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(ApiKeyClientVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(ApiKeyClientVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
